import React from 'react';
import './Hardware.css';

class Hardware extends React.Component {
    render() {
        return(
          <div className="hardware-page parallax">
              <div className="row" style={{height:"120vh"}}>
                  <div className="flex-column-60 col-hardware-left">
                      <div className="hardware-title">
                        Hardware
                      </div>
                      Hello
                  </div>
                  <div className="flex-column-40 col-hardware-right">
                      <div className="hardware-title">
                        BOM
                      </div>
                      <div className="hardware-form">
                        Hello
                      </div>
                  </div>
              </div>
          </div>
        )
    }
}

export default Hardware;
